import styled from "styled-components";

const AppContainer = styled.div`
  margin: .8rem;
  border: 0.4rem solid white;
  border-radius: 2rem;
  background: linear-gradient(180deg, rgb(46 0 78) 0%, rgb(84 0 133) 100%);
  overflow: hidden;
`

function App() {
  return (

    <AppContainer>
      <header className="App-header">
      </header>
    </AppContainer>

  );
}

export default App;
